import React from 'react';
import styled, {css} from 'styled-components'

const Circle = styled.div`
  width: 100px;
  height: 100px;
  background: ${props => props.color};
  border-radius: 50%;
`

export default function ItemDetail() {
  return <Circle color="blue" />;
}
